import React, { useEffect, useState } from 'react';
import BasePageWithCard from '../BasePages/BasePageWithCard';
import SupervisedStudentsCard from '../../components/SupervisedStudentsCard/SupervisedStudentsCard';
import axios from 'axios'; // Предположим, что вы используете axios для выполнения запросов

function SupervisedStudents({ requestData, schedule_stud_prof, work_protection }) {
  const [teacherData, setTeacherData] = useState(null);

  useEffect(() => {
    document.title = "Курируемые выпускники";

    // Функция для выполнения запроса API и установки данных преподавателя
    const fetchTeacherData = async () => {
      try {
        const response = await axios.get('http://127.0.0.1:8000/v1/main/teacher/request_all_work_schedule_personal_work_protection/');
        setTeacherData(response.data); // Предполагается, что данные приходят в формате JSON и устанавливаются в состояние
      } catch (error) {
        console.error('Ошибка при получении данных преподавателя:', error);
      }
    };

    // Вызываем функцию для получения данных преподавателя при загрузке компонента
    fetchTeacherData();
  }, []);

  return (
    <BasePageWithCard isAuthenticated={true} data={teacherData}>
      <SupervisedStudentsCard teacherData={teacherData} />
    </BasePageWithCard>
  );
}

export default SupervisedStudents;
